// src/components/DarkModeToggle.js
import React from 'react';

const DarkModeToggle = ({ toggleDarkMode }) => {
  return (
    <div className="dark-mode-toggle">
      <label>
        Dark Mode
        <input type="checkbox" onChange={toggleDarkMode} />
      </label>
    </div>
  );
};

export default DarkModeToggle;
